# -*- coding: iso-8859-1 -*-

import CairoChart, time, sys
import datetime

## Example 1 - monthly stat with independent y0 and y1-axis

data = [['10.2005', 47800, 3], ['11.2005', 43800, 7], ['12.2005', 64300, 5], ['01.2006', 75500, 4],
        ['02.2006', 48400, 10], ['03.2006', 52800, 3], ['04.2006', 45300, 3], ['05.2006', 41700, 1]]

img = CairoChart.Chart(width=330, height=250, out='cairochart01.png', 
                       colors={'bg':'#FFFFFF', 'fg' : '#000066', 'grid': '#AAAAAA'},
                       font={'name' : 'Trebuchet MS', 'size' : 10,
                             'bold' : False, 'italic' : False})
img.set_title('Monthly order stats', copyright = '(c) bettercom 2006')
img.set_legend([('Delivered orders', '#00AA00'), ('\nRefrained orders', '#AA4444')])
img.set_data(data, y2=[2], colwidth=40, align='r', abbreviate_nums=True, y_axis_scale_min=True)
img.draw_grid()
img.draw_data(dots=True)
img.output()

## Example 2 - monthly stat with stacked values and additional transparent text

data = [['10.2005', 481, 120, 455, 88], ['11.2005', 445, 93, 477, 188], ['12.2005', 548, 268, 825, 199],
        ['01.2006', 559, 301, 506, 277], ['02.2006', 494, 253, 665, 217], ['03.2006', 531, 115, 650, 103],
        ['04.2006', 455, 91, 425, 130], ['05.2006', 417, 140, 554, 180]]

img = CairoChart.Chart(width=330, height=250, out='cairochart02.png', 
                       colors={'bg':'#FFFFFF', 'fg' : '#000066', 'grid': '#AAAAAA'},
                       font={'name' : 'TSCu_Comic', 'size' : 10,
                             'bold' : False, 'italic' : False})
img.set_title('Monthly phone stats', copyright = '(c) 2006')
